import logo from './logo.svg';
import './App.css';
import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Container, FormGroup, Table, Button, Modal, ModalHeader, ModalBody, ModalFooter} from 'reactstrap';

class App extends React.Component {
  render(){
    return (
      <>
        <Container>
          <h1>Administracion de Departamentos</h1>
          <Button color='danger'>Nuevo Departamento</Button>
          <br></br>
          <Table className="table-bordered">
            <thead>
              <tr align="center">
                <th width="10%">Id</th>
                <th>Nombre</th>
                <th width="20%">Registro</th>
                <th width="10%">Status</th>
                <th width="12%">Usuario</th>
              </tr>
            </thead>
          </Table>
        </Container>
      </>
    );
  }
}

export default App;
